# Sub in std::ops - Rust

## Trait [std](../index.html)::[ops](index.html)::[Sub](#)

1.0.0 · [source](https://doc.rust-lang.org/1.80.0/src/core/ops/arith.rs.html#187) ·

```
pub trait Sub<Rhs = Self> {
    type Output;

    // Required method
    fn sub(self, rhs: Rhs) -> Self::Output;
}
```

Expand description

The subtraction operator `-`.

Note that `Rhs` is `Self` by default, but this is not mandatory. For example, [`std::time::SystemTime`](../../std/time/struct.SystemTime.html) implements `Sub<Duration>`, which permits operations of the form `SystemTime = SystemTime - Duration`.

## [§](#examples)Examples

### [§](#subtractable-points)`Sub`tractable points

```
use std::ops::Sub;

#[derive(Debug, Copy, Clone, PartialEq)]
struct Point {
    x: i32,
    y: i32,
}

impl Sub for Point {
    type Output = Self;

    fn sub(self, other: Self) -> Self::Output {
        Self {
            x: self.x - other.x,
            y: self.y - other.y,
        }
    }
}

assert_eq!(Point { x: 3, y: 3 } - Point { x: 2, y: 3 },
           Point { x: 1, y: 0 });
```

